                    <li>لا تحلل المواد البلاستيكية بيولوجياً ولا تحلل بالكامل ابدا</li>
                    <li>	تموت ملايين السلاحف والطيور البحرية وغيرها من الحيوانات البرية كل عام بسبب المضاعفات المرتبطة مباشرة باستهلاك البلاستيك. تشير التقديرات الي ان ما يصل الي ٧٠٪ من الطيور البحرية و٣٠٪ من السلاحف قد ابتلعت نوعا من البلاستيك من المحيط.</li>
